void main() {
  fun(num);
}

String num =
    "";

List<int> numList = [];

void fun(String num) {
  for (int i = 0; i < num.length - 12; i++) {
    int num1 = int.parse(num[i]);
    int num2 = int.parse(num[i + 1]);
    int num3 = int.parse(num[i + 2]);
    int num4 = int.parse(num[i + 3]);
    int num5 = int.parse(num[i + 4]);
    int num6 = int.parse(num[i + 5]);
    int num7 = int.parse(num[i + 6]);
    int num8 = int.parse(num[i + 7]);
    int num9 = int.parse(num[i + 8]);
    int num10 = int.parse(num[i + 9]);
    int num11 = int.parse(num[i + 10]);
    int num12 = int.parse(num[i + 11]);
    int num13 = int.parse(num[i + 12]);

    if (num1 != 0 &&
        num2 != 0 &&
        num3 != 0 &&
        num4 != 0 &&
        num5 != 0 &&
        num6 != 0 &&
        num7 != 0 &&
        num8 != 0 &&
        num9 != 0 &&
        num10 != 0 &&
        num11 != 0 &&
        num12 != 0 &&
        num13 != 0) {
      numList.add(num1 *
          num2 *
          num3 *
          num4 *
          num5 *
          num6 *
          num7 *
          num8 *
          num9 *
          num10 *
          num11 *
          num12 *
          num13);
    } else {
      continue;
    }
  }
  var value = numList.reduce(
    (value, element) => value > element ? value : element,
  );
  print(value);
}
